import React from "react";
import HyperCarPage from "./HyperCarPage";
import SportCarPage from "./SportCarPage";
import MomsCarPage from "./MomsCarPage";
import { Link } from "react-router-dom";
import "../Home.css";

function HomePage() {
  return (
    <div className="tri-card">
      <div className="link-container">
        <img className="image-card" src="https://www.bugatti.com/fileadmin/_processed_/sei/p623/se-image-b89ad55307404b88e769c0a09371e7a3.jpg" />
        <Link className= "text" to="/hypercar"> Hyper Cars</Link>
      </div>
      <div className="link-container">
        <img className="image-card" src="https://www.teahub.io/photos/full/170-1703090_2016-nissan-gt-r-wallpaper-hd-gtr-car.jpg" />
        <Link className= "text" to="/sportycar"> Sport Cars</Link>
      </div>
      <div className="link-container">
        <img className="image-card" src="https://pro2-bar-s3-cdn-cf3.myportfolio.com/989d3232-61d6-48dd-9b88-e91cf11ad809/495b022a-d18c-47b2-840e-b21134f3c2be_rw_3840.jpg?h=4aa981c4babf8a01a8da02248716a758" />
        <Link className= "text" to="/mommycar"> Mommy's Cars</Link>
      </div>
      <footer className="footer">
        <h1> Welcome to Zroom!</h1>
      </footer>
    </div>
  );
}

export default HomePage;
